import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

import { ThemeProvider } from '@material-ui/styles';
import SignInPic from '../assets/Fridge-signin-pic.png';
import { ReactComponent as FUBULogo } from '../assets/fubu_logo.svg';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import theme from '../theme';

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    logo: {
        paddingLeft: theme.spacing(.75),
        paddingTop: theme.spacing(8),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
}));

function SignIn() {
    const classes = useStyles();

    function FormRow() {
        return (
          <React.Fragment>
            <Grid item xs={4}>
            <Button variant="contained" color="primary">Sign Up</Button>
            </Grid>
            <Grid item xs={4}>
            <Button variant="contained" color="primary">Sign Up</Button>
            </Grid>
          </React.Fragment>
        );
      }


    return (
        <ThemeProvider theme={theme}>
            <Grid container>
                <Grid item xs={6}>
                    <div>
                        <img src={SignInPic} alt="communityFridge" />
                    </div>
                </Grid>
                <Grid item xs={6}>
                    <FUBULogo className={classes.logo}></FUBULogo>
                </Grid>
                <Button size="large" variant="contained" color="secondary">Log In</Button>

            </Grid>
        </ThemeProvider>

    );
}

export default SignIn;
